import React from 'react';
import { BrowserRouter, Route} from 'react-router-dom';
import LandingPage from '../components/LandingPage';
import BooksRead from '../components/BooksRead';
import BooksReading from '../components/BooksReading';
import BooksToRead from '../components/BooksToRead';
import Header from './Header';

const App = () => {
    return (
        <div>
            <BrowserRouter>
            <div>
                <Header/>
                <Route path="/" exact component={LandingPage} />
                <Route path="/read" exact component={BooksRead} />
                <Route path="/reading" exact component={BooksReading} />
                <Route path="/toread" exact component={BooksToRead}/>
                <Route path="/managestore" exact component={ManageStore} />
            </div>
            </BrowserRouter>
        </div>
    );
}

export default App;
